import React from 'react';
import Header from './Header';
import Footer from './Footer';
import SearchFlight from './SearchFlight';


import Corousal from './Corousal';



function Home(props) {
    

    return (
        <div>
            <Header />

            <main className="mb-4 mt-5">
                {/* <!-- Corousal section --> */}
                <section>
                    <Corousal />
                </section>

                <section style={styling.section_bg}>
                    <SearchFlight />
                </section>
                

                <section className="container-fluid  pt-3 pb-5 section-bg" style={styling.section_bg}>
                    <h2 style={styling.subheading}>Why BookMyFlight?</h2>
                    <div className="m-auto row">                       
                        {featureCard}
                    </div>
                </section>

            </main>

            <Footer />

        </div>
    );
}

let styling = {
    subheading : {
        textAlign: "center",
        color: "#333333",
        fontFamily: "Verdana",
        padding: 20
    },
    section_bg : {
        background : "linear-gradient(180deg, transparent, #6666ff)"
    },
    card : {
        background : "#00001a",
        color : "white"
    }
}

export default Home;
